import React from "react";
import { SidebarContainer, Icon, CloseIcon } from "./SidebarElements";

const Sidebar = () => {
  return (
    <div>
      <SidebarContainer>
        <Icon>
          <CloseIcon />
        </Icon>
        <SidebarWrapper>
          <SidebarMenu>
            <SidebarLink to="aboutMe"></SidebarLink>
          </SidebarMenu>
        </SidebarWrapper>
      </SidebarContainer>
    </div>
  );
};

export default Sidebar;
